function preLoader() {
	let counts = setInterval(updated, 5);
	let upto = 0;
	function updated() {
		let count = document?.querySelector(".preLoader .counter span");
		count.innerHTML = ++upto;
		if (upto === 100) {
			clearInterval(counts);
			const tl = gsap.timeline({
				duration: 0.1
			});
			tl.to(".preLoader .counter", {
				autoAlpha: 0,
			})
				.to(".preLoader .bar", {
					width: 0,
					stagger: 0.09,
					ease: "power4.inOut",
				})
				.to(".preLoader", {
					css: {
						display: "none"
					},
				})
				.from('.top-logo > img', {
					scale: 0,
					autoAlpha: 0
				},
					1)
				.from(
					".headline, .deliver > li", {
					x: 50,
					stagger: 0.1,
					autoAlpha: 0,
				},
					1
				)
				.from(
					".an-navbar .search, .cart-list > li, .menuBar", {
					scale: 0,
					stagger: 0.1,
					autoAlpha: 0,
				},
					1
				)
				.from(
					".heroSlider", {
					autoAlpha: 0.5,
					scale: 0.8,
					stagger: 0.2,
				},
					1.2
				)
				.from(
					".slideOne", {
					autoAlpha: 0,
					y: 50,
					stagger: 0.1,
				},
					1.5
				)
			document.querySelector("body").classList.remove("loading");
		}
	}
}
$(window).on('load', function () {
	let str = window.location.href;
	str = str.split('/');
	if (str.at(-1) === 'index.php' || str.at(-1) === '') {
		preLoader();
	} else { }
});

