function btnMenu() {
	document.querySelector(".btn-menu").addEventListener("click", () => {
		document.querySelector("body").classList.toggle("isopen");
	});
}
function mousecursor() {
	if ($('body')) {
		const e = document.querySelector('.cursor-inner'),
			t = document.querySelector('.cursor-outer');
		let n,
			i = 0,
			o = !1;
		(window.onmousemove = function (s) {
			o || (t.style.transform = 'translate(' + s.clientX + 'px, ' + s.clientY + 'px)'), (e.style.transform = 'translate(' + s.clientX + 'px, ' + s.clientY + 'px)'), (n = s.clientY), (i = s.clientX);
		}),
			$('body').on('mouseenter', 'a, img, .cursor-pointer', function () {
				e.classList.add('cursor-hover'), t.classList.add('cursor-hover');
			}),
			$('body').on('mouseleave', 'a, img, .cursor-pointer', function () {
				($(this).is('a, img') && $(this).closest('.cursor-pointer').length) || (e.classList.remove('cursor-hover'), t.classList.remove('cursor-hover'));
			}),
			(e.style.visibility = 'visible'),
			(t.style.visibility = 'visible');
	}
}

function replaceHash() {
	document.querySelectorAll("a").forEach((a) => {
		let href = a.getAttribute("href");
		a.href = href ?
			href.startsWith("#") && href.endsWith("#") ?
				href.replace("#", "javascript:void(0)") :
				href :
			"javascript:void(0)";
	});
}
function range() {
	$(function () {
		$("#slider-range").slider({
			range: true,
			min: 0,
			max: 200,
			values: [0, 200],
			slide: function (event, ui) {
				$("#amount").val("$" + ui.values[0]);
				$("#amount1").val("$" + ui.values[1]);

			}
		});
		$("#amount").val("$" + $("#slider-range").slider("values", 0));
		$("#amount1").val("$" + $("#slider-range").slider("values", 1));
	});

}

function lenisSetup() {
	const lenis = new Lenis({
		duration: 1.2,
		easing: (t) => (t === 1 ? 1 : 1 - Math.pow(2, -10 * t)),
		direction: "vertical",
		gestureDirection: "vertical",
		smooth: true,
		smoothTouch: false,
		touchMultiplier: 2,
	})
	lenis.scrollTo(document.querySelector('.scrolllenis'))

	function raf(time) {
		lenis.raf(time)
		requestAnimationFrame(raf)
	}

	requestAnimationFrame(raf);

}

$(function () {
	btnMenu()
	allSlider()
	mousecursor();
	replaceHash()
	range()
	lenisSetup();
	AOS.init({
		duration: 1200,
		disable: function () {
			var maxWidth = 1200;
			return window.innerWidth < maxWidth;
		}
	});
	featureSection()
});